const t=JSON.parse('{"key":"v-7dc08557","path":"/code/rabbitmq/04/10.html","title":"消息传输保障","lang":"zh-CN","frontmatter":{"summary":"消息传输保障 消息可靠传输 一般是业务系统接入消息中间件首要考虑的问题，一般消息中间件的消息传输保障分为三个层级： At most once：最多一次。消息可能会丢失，但绝不会重复传输; At least once：最少一次。消息绝不会丢失，但可能重复传输; Exactly once：恰好一次。每条消息肯定会被传输一次且仅传输一次。; RabbitMQ 支持","head":[["meta",{"property":"og:url","content":"https://bamboo-qiqing.github.io/code/rabbitmq/04/10.html"}],["meta",{"property":"og:site_name","content":"Bamboo"}],["meta",{"property":"og:title","content":"消息传输保障"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2022-07-15T03:26:30.000Z"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"article:modified_time","content":"2022-07-15T03:26:30.000Z"}]]},"excerpt":"","headers":[],"git":{"createdTime":1657855590000,"updatedTime":1657855590000,"contributors":[{"name":"guoqing","email":"15225822319@163.com","commits":1}]},"readingTime":{"minutes":1.88,"words":563},"filePathRelative":"code/rabbitmq/04/10.md","localizedDate":"2022年7月15日"}');export{t as data};
